import React, { useState } from 'react';

const CreateTournament = () => {
    const [tournamentName, setTournamentName] = useState('');
    const [registrationDeadline, setRegistrationDeadline] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Qui puoi gestire l'invio dei dati, ad esempio inviando una richiesta a un server
        console.log(`Tournament Name: ${tournamentName}, Registration Deadline: ${registrationDeadline}`);
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label htmlFor="tournamentName">Nome del Torneo:</label>
                <input
                    type="text"
                    id="tournamentName"
                    value={tournamentName}
                    onChange={(e) => setTournamentName(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="registrationDeadline">Termine ultimo di iscrizione:</label>
                <input
                    type="date"
                    id="registrationDeadline"
                    value={registrationDeadline}
                    onChange={(e) => setRegistrationDeadline(e.target.value)}
                />
            </div>
            <button type="submit">Crea Torneo</button>
        </form>
    );
};

export default CreateTournament;
